contracts/PropertyRental.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.8;

contract PropertyRental {
    struct Property {
        uint256 id;
        address owner;
        string location;
        uint256 rentPrice;
        bool isRented;
    }

    struct Tenant {
        address tenantAddress;
        uint256 rentedPropertyId;
        uint256 startDate;
        uint256 endDate;
    }

    struct Complain {
        uint256 id;
        address owner;
        string details;
        uint256 date;
    }

    mapping(uint256 => Property) public properties;
    mapping(address => Tenant) public tenants;
    mapping(uint256 => Complain[]) public propertyIdToComplaints;

    uint256 public propertyCount;
    uint256 public complaintCount;

    event PropertyAdded(uint256 id, string location, uint256 rentPrice);
    event PropertyRented(uint256 id, address tenant, uint256 startDate, uint256 endDate);
    event PropertyComplained(uint256 indexed propertyId, uint256 indexed complaintId, address indexed owner, string details, uint256 date);

    function addProperty(string memory _location, uint256 _rentPrice) public {
        propertyCount++;
        properties[propertyCount] = Property(propertyCount, msg.sender, _location, _rentPrice, false);
        emit PropertyAdded(propertyCount, _location, _rentPrice);
    }

    function rentProperty(uint256 _id, uint256 _startDate, uint256 _endDate) public {
        require(_startDate < _endDate, "Start date should be less than end date");
        require(properties[_id].isRented == false, "Property is already rented");

        properties[_id].isRented = true;
        tenants[msg.sender] = Tenant(msg.sender, _id, _startDate, _endDate);
        emit PropertyRented(_id, msg.sender, _startDate, _endDate);
    }

    function complainProperty(uint256 _id, string memory _details) public {
        require(properties[_id].id != 0, "Property doesn't exist");
        require(properties[_id].owner == msg.sender, "Only the owner can complain about the property");

        Complain memory newComplain = Complain({
            id: complaintCount,
            owner: msg.sender,
            details: _details,
            date: block.timestamp
        });

        propertyIdToComplaints[_id].push(newComplain);
        complaintCount++;

        emit PropertyComplained(_id, newComplain.id, msg.sender, _details, newComplain.date);
    }
}

